Defendant in custody.
Defendant is before the Court for sentencing, his probation having been revoked effective 09-28-16.  
Court sentences the defendant to the Wisconsin State Prison System for six (6) years.  Two and one-half (2 1/2) years initial confinement followed by three and one-half (3 1/2) years extended supervision.  Conditions of extended supervision are:
1) Have no possession of any smart phone;
2) Have access to the internet only if the agent believes it appropriate;
3) Have no contact with anyone under the age of 18 without agent's approval except for family members with another adult present;
4) Maintain full-time employment;
5) Comply with therapy;
6) Register as a sex offender and comply with registry;
7) Pay costs of the action; and
8) Pay supervision fees in an amount to be determined by DOC.
Court finds the defendant is not eligible for the Challenge Incarceration Program or the Substance Abuse Program.
Jail credit to be determined.
Minutes.

Defendant in custody.   
State files an Amended Information amending count 1 to Child Enticement-take pictures, contrary to Section 948.07(4) of the Wisconsin Statutes, a Class D felony.  
No contest plea to the amended charge.   Convicted.   State moves to dismiss and read in counts 2-10.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for seven (7) years.   Conditions of probation are:
1) Spend ten (10) months in the Manitowoc County Jail, to commence immediately, under the Huber Law, including treatment subject to jail rules;
2) Have no possession of any smart phone;
3) Have access to the internet only if the agent believes it appropriate;
4) Have no contact with anyone under the age of 18 without agent's approval except for family members with another adult present;
5) Maintain full-time employment;
6) Comply with therapy;
7) Register as a sex offender and comply with registry; 
8) Submit DNA sample;
9) Pay costs of action; 
10) Pay supervision fees in an amount to be determined by DOC.  
